 ["<a name=\"L1484\">1484</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"p\">}</span></pre></div>", ""], ["<a name=\"L1485\">1485</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1486\">1486</a>", "", "", "<div class=\"highlight\"><pre>  <span class=\"nl\">endlabel</span><span class=\"p\">:</span></pre></div>", ""], ["<a name=\"L1487\">1487</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"n\">Py_TRASHCAN_END</span></pre></div>", ""], ["", "0.12%", {"class": "column-entry-red", "text": "inline"}, {"class": "column-entry-yellow", "text": "<span style=\"margin-left: 6ch;\" class=\"indent-span\">&bull;  _PyTrash_end will not be inlined into subtype_dealloc because its definition is unavailable&nbsp;</span>"}, {"class": "column-entry-yellow", "text": "subtype_dealloc"}], ["<a name=\"L1488\">1488</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1489\">1489</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"cm\">/* Explanation of the weirdness around the trashcan macros:</span></pre></div>", ""], ["<a name=\"L1490\">1490</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1491\">1491</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       Q. What do the trashcan macros do?</span></pre></div>", ""], ["<a name=\"L1492\">1492</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1493\">1493</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       A. Read the comment titled &quot;Trashcan mechanism&quot; in object.h.</span></pre></div>", ""], ["<a name=\"L1494\">1494</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          For one, this explains why there must be a call to GC-untrack</span></pre></div>", ""], ["<a name=\"L1495\">1495</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          before the trashcan begin macro.      Without understanding the</span></pre></div>", ""], ["<a name=\"L1496\">1496</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          trashcan code, the answers to the following questions don&#39;t make</span></pre></div>", ""], ["<a name=\"L1497\">1497</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          sense.</span></pre></div>", ""], ["<a name=\"L1498\">1498</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1499\">1499</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       Q. Why do we GC-untrack before the trashcan and then immediately</span></pre></div>", ""], ["<a name=\"L1500\">1500</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          GC-track again afterward?</span></pre></div>", ""], ["<a name=\"L1501\">1501</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1502\">1502</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       A. In the case that the base class is GC-aware, the base class</span></pre></div>", ""], ["<a name=\"L1503\">1503</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          probably GC-untracks the object.      If it does that using the</span></pre></div>", ""], ["<a name=\"L1504\">1504</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          UNTRACK macro, this will crash when the object is already</span></pre></div>", ""], ["<a name=\"L1505\">1505</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          untracked.  Because we don&#39;t know what the base class does, the</span></pre></div>", ""], ["<a name=\"L1506\">1506</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          only safe thing is to make sure the object is tracked when we</span></pre></div>", ""], ["<a name=\"L1507\">1507</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          call the base class dealloc.  But...  The trashcan begin macro</span></pre></div>", ""], ["<a name=\"L1508\">1508</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          requires that the object is *untracked* before it is called.  So</span></pre></div>", ""], ["<a name=\"L1509\">1509</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          the dance becomes:</span></pre></div>", ""], ["<a name=\"L1510\">1510</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1511\">1511</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">         GC untrack</span></pre></div>", ""], ["<a name=\"L1512\">1512</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">         trashcan begin</span></pre></div>", ""], ["<a name=\"L1513\">1513</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">         GC track</span></pre></div>", ""], ["<a name=\"L1514\">1514</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1515\">1515</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       Q. Why did the last question say &quot;immediately GC-track again&quot;?</span></pre></div>", ""], ["<a name=\"L1516\">1516</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          It&#39;s nowhere near immediately.</span></pre></div>", ""], ["<a name=\"L1517\">1517</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1518\">1518</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       A. Because the code *used* to re-track immediately.      Bad Idea.</span></pre></div>", ""], ["<a name=\"L1519\">1519</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          self has a refcount of 0, and if gc ever gets its hands on it</span></pre></div>", ""], ["<a name=\"L1520\">1520</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          (which can happen if any weakref callback gets invoked), it</span></pre></div>", ""], ["<a name=\"L1521\">1521</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          looks like trash to gc too, and gc also tries to delete self</span></pre></div>", ""], ["<a name=\"L1522\">1522</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          then.  But we&#39;re already deleting self.  Double deallocation is</span></pre></div>", ""], ["<a name=\"L1523\">1523</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">          a subtle disaster.</span></pre></div>", ""], ["<a name=\"L1524\">1524</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">    */</span></pre></div>", ""], ["<a name=\"L1525\">1525</a>", "", "", "<div class=\"highlight\"><pre><span class=\"p\">}</span></pre></div>", ""], ["<a name=\"L1526\">1526</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1527\">1527</a>", "", "", "<div class=\"highlight\"><pre><span class=\"k\">static</span> <span class=\"n\">PyTypeObject</span> <span class=\"o\">*</span><span class=\"nf\">solid_base</span><span class=\"p\">(</span><span class=\"n\">PyTypeObject</span> <span class=\"o\">*</span><span class=\"n\">type</span><span class=\"p\">);</span></pre></div>", ""], ["<a name=\"L1528\">1528</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1529\">1529</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">/* type test with subclassing support */</span></pre></div>", ""], ["<a name=\"L1530\">1530</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1531\">1531</a>", "", "", "<div class=\"highlight\"><pre><span class=\"k\">static</span> <span class=\"kt\">int</span></pre></div>", ""], ["<a name=\"L1532\">1532</a>", "", "", "<div class=\"highlight\"><pre><span class=\"nf\">type_is_subtype_base_chain</span><span class=\"p\">(</span><span class=\"n\">PyTypeObject</span> <span class=\"o\">*</span><span class=\"n\">a</span><span class=\"p\">,</span> <span class=\"n\">PyTypeObject</span> <span class=\"o\">*</span><span class=\"n\">b</span><span class=\"p\">)</span></pre> e></div>", ""], ["<a name=\"L4449\">4449</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      excess (i.e., any) arguments, since their presence could</span></pre></div>", ""], ["<a name=\"L4450\">4450</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      indicate there&#39;s a bug.</span></pre></div>", ""], ["<a name=\"L4451\">4451</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4452\">4452</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   2. When defining an Immutable type, we are likely to override only</span></pre></div>", ""], ["<a name=\"L4453\">4453</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      __new__(), since __init__() is called too late to initialize an</span></pre></div>", ""], ["<a name=\"L4454\">4454</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      Immutable object.  Since __new__() defines the signature for the</span></pre></div>", ""], ["<a name=\"L4455\">4455</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      type, it would be a pain to have to override __init__() just to</span></pre></div>", ""], ["<a name=\"L4456\">4456</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      stop it from complaining about excess arguments.</span></pre></div>", ""], ["<a name=\"L4457\">4457</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4458\">4458</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   3. When defining a Mutable type, we are likely to override only</span></pre></div>", ""], ["<a name=\"L4459\">4459</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      __init__().  So here the converse reasoning applies: we don&#39;t</span></pre></div>", ""], ["<a name=\"L4460\">4460</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">      want to have to override __new__() just to stop it from</span></pre></div>", ""], ["<a name=\"L4461\"> class=\"highlight\"><pre>        <span class=\"k\">return</span> <span class=\"o\">-</span><span class=\"mi\">1</span><span class=\"p\">;</span></pre></div>", ""], ["<a name=\"L4795\">4795</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"p\">}</span></pre></div>", ""], ["<a name=\"L4796\">4796</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4797\">4797</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"cm\">/* In versions of CPython prior to 3.5, the code in</span></pre></div>", ""], ["<a name=\"L4798\">4798</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       compatible_for_assignment was not set up to correctly check for memory</span></pre></div>", ""], ["<a name=\"L4799\">4799</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       layout / slot / etc. compatibility for non-HEAPTYPE classes, so we just</span></pre></div>", ""], ["<a name=\"L4800\">4800</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       disallowed __class__ assignment in any case that wasn&#39;t HEAPTYPE -&gt;</span></pre></div>", ""], ["<a name=\"L4801\">4801</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       HEAPTYPE.</span></pre></div>", ""], ["<a name=\"L4802\">4802</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4803\">4803</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       During the 3.5 development cycle, we fixed the code in</span></pre></div>", ""], ["<a name=\"L4804\">4804</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       compatible_for_assignment to correctly check compatibility between</span></pre></div>", ""], ["<a name=\"L4805\">4805</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       arbitrary types, and started allowing __class__ assignment in all cases</span></pre></div>", ""], ["<a name=\"L4806\">4806</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       where the old and new types did in fact have compatible slots and</span></pre></div>", ""], ["<a name=\"L4807\">4807</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       memory layout (regardless of whether they were implemented as HEAPTYPEs</span></pre></div>", ""], ["<a name=\"L4808\">4808</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       or not).</span></pre></div>", ""], ["<a name=\"L4809\">4809</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4810\">4810</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       Just before 3.5 was released, though, we discovered that this led to</span></pre></div>", ""], ["<a name=\"L4811\">4811</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       problems with immutable types like int, where the interpreter assumes</span></pre></div>", ""], ["<a name=\"L4812\">4812</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       they are immutable and interns some values. Formerly this wasn&#39;t a</span></pre></div>", ""], ["<a name=\"L4813\">4813</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       problem, because they really were immutable -- in particular, all the</span></pre></div>", ""], ["<a name=\"L4814\">4814</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       types where the interpreter applied this interning trick happened to</span></pre></div>", ""], ["<a name=\"L4815\">4815</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       also be statically allocated, so the old HEAPTYPE rules were</span></pre></div>", ""], ["<a name=\"L4816\">4816</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       &quot;accidentally&quot; stopping them from allowing __class__ assignment. But</span></pre></div>", ""], ["<a name=\"L4817\">4817</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       with the changes to __class__ assignment, we started allowing code like</span></pre></div>", ""], ["<a name=\"L4818\">4818</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4819\">4819</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">         class MyInt(int):</span></pre></div>", ""], ["<a name=\"L4820\">4820</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">             ...</span></pre></div>", ""], ["<a name=\"L4821\">4821</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">         # Modifies the type of *all* instances of 1 in the whole program,</span></pre></div>", ""], ["<a name=\"L4822\">4822</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">         # including future instances (!), because the 1 object is interned.</span></pre></div>", ""], ["<a name=\"L4823\">4823</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">         (1).__class__ = MyInt</span></pre></div>", ""], ["<a name=\"L4824\">4824</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4825\">4825</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       (see https://bugs.python.org/issue24912).</span></pre></div>", ""], ["<a name=\"L4826\">4826</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4827\">4827</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       In theory the proper fix would be to identify which classes rely on</span></pre></div>", ""], ["<a name=\"L4828\">4828</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       this invariant and somehow disallow __class__ assignment only for them,</span></pre></div>", ""], ["<a name=\"L4829\">4829</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       perhaps via some mechanism like a new Py_TPFLAGS_IMMUTABLE flag (a</span></pre></div>", ""], ["<a name=\"L4830\">4830</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       &quot;denylisting&quot; approach). But in practice, since this problem wasn&#39;t</span></pre></div>", ""], ["<a name=\"L4831\">4831</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       noticed late in the 3.5 RC cycle, we&#39;re taking the conservative</span></pre></div>", ""], ["<a name=\"L4832\">4832</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       approach and reinstating the same HEAPTYPE-&gt;HEAPTYPE check that we used</span></pre></div>", ""], ["<a name=\"L4833\">4833</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       to have, plus an &quot;allowlist&quot;. For now, the allowlist consists only of</span></pre></div>", ""], ["<a name=\"L4834\">4834</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       ModuleType subtypes, since those are the cases that motivated the patch</span></pre></div>", ""], ["<a name=\"L4835\">4835</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       in the first place -- see https://bugs.python.org/issue22986 -- and</span></pre></div>", ""], ["<a name=\"L4836\">4836</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       since module objects are mutable we can be sure that they are</span></pre></div>", ""], ["<a name=\"L4837\">4837</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       definitely not being interned. So now we allow HEAPTYPE-&gt;HEAPTYPE *or*</span></pre></div>", ""], ["<a name=\"L4838\">4838</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       ModuleType subtype -&gt; ModuleType subtype.</span></pre></div>", ""], ["<a name=\"L4839\">4839</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L4840\">4840</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       So far as we know, all the code beyond the following &#39;if&#39; statement</span></pre></div>", ""], ["<a name=\"L4841\">4841</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       will correctly handle non-HEAPTYPE classes, and the HEAPTYPE check is</span></pre></div>", ""], ["<a name=\"L4842\">4842</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       needed only to protect that subset of non-HEAPTYPE classes for which</span></pre></div>", ""], ["<a name=\"L4843\">4843</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       the interpreter has baked in the assumption that all instances are</span></pre></div>", ""], ["<a name=\"L4844\">4844</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       truly immutable.</span></pre></div>", ""], ["<a name=\"L4845\">4845</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">    */</span></pre></div>", ""], ["<a name=\"L4846\">4846</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"k\">if</span> <span class=\"p\">(</span><span class=\"o\">!</span><span class=\"p\">(</span><span class=\"n\">PyType_IsSubtype</span><span class=\"p\">(</span><span class=\"n\">newto</span><span class=\"p\">,</span> <span class=\"o\">&amp;</span><span class=\"n\">PyModule_Type</span><span class=\"p\">)</span> <span class=\"o\">&amp;&amp;</span></pre></div>", ""], ["<a name=\"L4847\">4847</a>", "", "", "<div class=\"highlight\"><pre>          <span class=\"n\">PyType_IsSubtype</span><span class=\"p\">(</span><span class=\"n\">oldto</span><span class=\"p\">,</span> <span class=\"o\">&amp;</span><span class=\"n\">PyModule_Type</span><span class=\"p\">))</span> <span class=\"o\">&amp;&amp;</span></pre></div>", ""], ["<a name=\"L4848\">4848</a>", "", "", "<div class=\"highlight\"><pre>        <span class=\"p\">(</span><span class=\"n\">_PyType_HasFeature</span><span class=\"p\">(</span><span class=\"n\">newto</span><span class=\"p\">,</span> <span class=\"n\">Py_TPFLAGS_IMMUTABLETYPE</span><span class=\"p\">)</span> <span class=\"o\">||</span></pre></div>", ""], ["", "0.00%", {"class": "column-entry-red", "text": "gvn"}, {"class": "column-entry-yellow", "text": "<span style=\"margin-left: 10ch;\" class=\"indent-span\">&bull;  load of type i64 not eliminated because it is clobbered by <a href=\"Objects_typeobject.c.html#L4792\">call</a>&nbsp;</span>"}, {"class": "column-entry-yellow", "text": "object_set_class"}], ["<a name=\"L4849\">4849</a>", "", "", "<div class=\"highlight\"><pre>         <span class=\"n\">_PyType_HasFeature</span><span class=\"p\">(</span><span class=\"n\">oldto</span><span class=\"p\">,</span> <span class=\"n\">Py_TPFLAGS_IMMUTABLETYPE</span><span class=\"p\">)))</span> <span class=\"p\">{</span></pre></div>", ""], ["", "0.00%", {"class": "column-entry-red", "text": "gvn"}, {"class": "column-entry-yellow", "text": "<span style=\"margin-left: 11ch;\" class=\"indent-span\">&bull;  load of type i64 not eliminated because it is clobbered by <a href=\"Objects_typeobject.c.html#L4792\">call</a>&nbsp;</span>"}, {"class": "column-entry-yellow", "text": "object_set_class"}], ["<a name=\"L4850\">4850</a>", "", "", "<div class=\"highlight\"><pre>        <span class=\"n\">PyErr_Format</span><span class=\"p\">(</span><span class=\"n\">PyExc_TypeError</span><span class=\"p\">,</span></pre></div>", ""], ["", "0.00%", {"class": "column-entry-red", "text": "inline"}, {"class": "column-entry-yellow", "text": "<span style=\"margin-left: 10ch;\" class=\"indent-span\">&bull;  <a href=\"._Include_pyerrors.h.html#L0\">PyErr_Format</a> will not be inlined into object_set_class because its definition is unavailable&nbsp;</span>"}, {"class": "column-entry-yellow", "text": "object_set_class"}], ["", "0.00%", {"class": "column-entry-red", "text": "gvn"}, {"class": "column-entry-yellow", "text": "<span style=\"margin-left: 10ch;\" class=\"indent-span\">&bull;  load of type %struct._object* not eliminated because it is clobbered by <a href=\"Objects_typeobject.c.html#L4792\">call</a>&nbsp;</span>"}, {"class": "column-entry-yellow", "text": "object_set_class"}], ["<a name=\"L4851\">4851</a>", "", "", "<div class=\"highlight\"><pre>                     <span class= pre></div>", ""], ["<a name=\"L8244\">8244</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"p\">}</span></pre></div>", ""], ["<a name=\"L8245\">8245</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"k\">return</span> <span class=\"n\">res</span><span class=\"p\">;</span></pre></div>", ""], ["<a name=\"L8246\">8246</a>", "", "", "<div class=\"highlight\"><pre><span class=\"p\">}</span></pre></div>", ""], ["<a name=\"L8247\">8247</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L8248\">8248</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L8249\">8249</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">/* Common code for update_slots_callback() and fixup_slot_dispatchers().</span></pre></div>", ""], ["<a name=\"L8250\">8250</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> *</span></pre></div>", ""], ["<a name=\"L8251\">8251</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * This is meant to set a &quot;slot&quot; like type-&gt;tp_repr or</span></pre></div>", ""], ["<a name=\"L8252\">8252</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * type-&gt;tp_as_sequence-&gt;sq_concat by looking up special methods like</span></pre></div>", ""], ["<a name=\"L8253\">8253</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * __repr__ or __add__. The opposite (adding special methods from slots) is</span></pre></div>", ""], ["<a name=\"L8254\">8254</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * done by add_operators(), called from PyType_Ready(). Since update_one_slot()</span></pre></div>", ""], ["<a name=\"L8255\">8255</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * calls PyType_Ready() if needed, the special methods are already in place.</span></pre></div>", ""], ["<a name=\"L8256\">8256</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> *</span></pre></div>", ""], ["<a name=\"L8257\">8257</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * The special methods corresponding to each slot are defined in the &quot;slotdef&quot;</span></pre></div>", ""], ["<a name=\"L8258\">8258</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * array. Note that one slot may correspond to multiple special methods and vice</span></pre></div>", ""], ["<a name=\"L8259\">8259</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * versa. For example, tp_richcompare uses 6 methods __lt__, ..., __ge__ and</span></pre></div>", ""], ["<a name=\"L8260\">8260</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * tp_as_number-&gt;nb_add uses __add__ and __radd__. In the other direction,</span></pre></div>", ""], ["<a name=\"L8261\">8261</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * __add__ is used by the number and sequence protocols and __getitem__ by the</span></pre></div>", ""], ["<a name=\"L8262\">8262</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * sequence and mapping protocols. This causes a lot of complications.</span></pre></div>", ""], ["<a name=\"L8263\">8263</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> *</span></pre></div>", ""], ["<a name=\"L8264\">8264</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * In detail, update_one_slot() does the following:</span></pre></div>", ""], ["<a name=\"L8265\">8265</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> *</span></pre></div>", ""], ["<a name=\"L8266\">8266</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * First of all, if the slot in question does not exist, return immediately.</span></pre></div>", ""], ["<a name=\"L8267\">8267</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * This can happen for example if it&#39;s tp_as_number-&gt;nb_add but tp_as_number</span></pre></div>", ""], ["<a name=\"L8268\">8268</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * is NULL.</span></pre></div>", ""], ["<a name=\"L8269\">8269</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> *</span></pre></div>", ""], ["<a name=\"L8270\">8270</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * For the given slot, we loop over all the special methods with a name</span></pre></div>", ""], ["<a name=\"L8271\">8271</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * corresponding to that slot (for example, for tp_descr_set, this would be</span></pre></div>", ""], ["<a name=\"L8272\">8272</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * __set__ and __delete__) and we look up these names in the MRO of the type.</span></pre></div>", ""], ["<a name=\"L8273\">8273</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * If we don&#39;t find any special method, the slot is set to NULL (regardless of</span></pre></div>", ""], ["<a name=\"L8274\">8274</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * what was in the slot before).</span></pre></div>", ""], ["<a name=\"L8275\">8275</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> *</span></pre></div>", ""], ["<a name=\"L8276\">8276</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * Suppose that we find exactly one special method. If it&#39;s a wrapper_descriptor</span></pre></div>", ""], ["<a name=\"L8277\">8277</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * (i.e. a special method calling a slot, for example str.__repr__ which calls</span></pre></div>", ""], ["<a name=\"L8278\">8278</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * the tp_repr for the &#39;str&#39; class) with the correct name (&quot;__repr__&quot; for</span></pre></div>", ""], ["<a name=\"L8279\">8279</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * tp_repr), for the right class, calling the right wrapper C function (like</span></pre></div>", ""], ["<a name=\"L8280\">8280</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * wrap_unaryfunc for tp_repr), then the slot is set to the slot that the</span></pre></div>", ""], ["<a name=\"L8281\">8281</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * wrapper_descriptor originally wrapped. For example, a class inheriting</span></pre></div>", ""], ["<a name=\"L8282\">8282</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * from &#39;str&#39; and not redefining __repr__ will have tp_repr set to the tp_repr</span></pre></div>", ""], ["<a name=\"L8283\">8283</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * of &#39;str&#39;.</span></pre></div>", ""], ["<a name=\"L8284\">8284</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * In all other cases where the special method exists, the slot is set to a</span></pre></div>", ""], ["<a name=\"L8285\">8285</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * wrapper calling the special method. There is one exception: if the special</span></pre></div>", ""], ["<a name=\"L8286\">8286</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * method is a wrapper_descriptor with the correct name but the type has</span></pre></div>", ""], ["<a name=\"L8287\">8287</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * precisely one slot set for that name and that slot is not the one that we</span></pre></div>", ""], ["<a name=\"L8288\">8288</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * are updating, then NULL is put in the slot (this exception is the only place</span></pre></div>", ""], ["<a name=\"L8289\">8289</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * in update_one_slot() where the *existing* slots matter).</span></pre></div>", ""], ["<a name=\"L8290\">8290</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> *</span></pre></div>", ""], ["<a name= function toggleExpandedMessage(e) {
  var FullTextElems = e.parentElement.parentElement.getElementsByClassName("full-info");
  if (!FullTextElems || FullTextElems.length < 1) {
      return false;
  }
  var FullText = FullTextElems[0];
  if (FullText.style.display == 'none') {
    e.innerHTML = '-';
    FullText.style.display = 'block';
  } else {
    e.innerHTML = '+';
    FullText.style.display = 'none';
  }
}
